import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {
  return (
    <div className="hero-container">
    <iframe width="1078" height="480" src="https://www.youtube.com/embed/ypIB2yhna88" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
      <h1>ADVENTURE AWAITS</h1>
      <p>What are you waiting for?</p>
      <div className="hero-btns">
          <Button className="btns" buttonStyle="btn--outline" buttonSize="btn--large">
            GET STARTED
          </Button>
          <Button className="btns" buttonStyle="btn--primary" buttonSize="btn--large">
            WATCH TRAILER <i className='far fa-play-circle' />
          </Button>
      </div>
    </div>
  )
}

export default HeroSection
